import React from 'react';
import htmlIcon from './assets/html-icon.png';
import cssIcon from './assets/css-icon.png';
import reactIcon from './assets/react-icon.png';
import angularIcon from './assets/angular-icon.png';
import iosIcon from './assets/ios-icon.png';
import appDevIcon from './assets/app-dev-icon.png';

const SkillsSection = () => {
  return (
    <div className="skills-section">
      <h2>My Skills</h2>
      <div className="skills-grid">
        <div className="skill-item html">
          <img src={htmlIcon} alt="HTML" />
          <span>HTML</span>
        </div>
        <div className="skill-item css">
          <img src={cssIcon} alt="CSS" />
          <span>CSS</span>
        </div>
        <div className="skill-item react">
          <img src={reactIcon} alt="React JS" />
          <span>React JS</span>
        </div>
        <div className="skill-item angular">
          <img src={angularIcon} alt="Angular" />
          <span>Angular</span>
        </div>
        <div className="skill-item ios">
          <img src={iosIcon} alt="iOS App" />
          <span>iOS App</span>
        </div>
        <div className="skill-item app-dev">
          <img src={appDevIcon} alt="App Dev" />
          <span>App Dev</span>
        </div>
      </div>
    </div>
  );
};

export default SkillsSection;
